import React, { Component } from "react";
import axios from "axios";
import { DataTable } from "primereact/datatable";
import { Column } from "primereact/column";
import { Button } from "primereact/button";
import { MenueHeader } from "../MenueHeader";
import { FormFeld } from "../../services/FormFeld";

class Vereine2 extends Component {
  state = {
    data: [],
    selectedVerein: null,
    loading: true,
    error: null,
    vereinFormEditMode: false,
    modusNeuerVerein: true,
    btnLöschenIsDisabled: true,
    btnÄndernIsDisabled: true,
    btnNeuerVereinIsDisabled: false,
    setModusNeuerVerein: false,
  };

  componentDidMount() {
    this.fetchVereineData();
  }

  fetchVereineData = () => {
    axios
      .get("http://localhost:8080/verein") // Replace with your Spring Boot API endpoint
      .then((response) => {
        this.setState({
          data: response.data,
          loading: false,
          error: null,
        });
      })
      .catch((error) => {
        this.setState({
          data: [],
          loading: false,
          error: "An error occurred while fetching data.",
        });
      });
  };

  btnNeuerVerein = () => {
    // Felder leeren und auf Input umschalten
    this.setState.setModusNeuerVerein(true);
    // setBtnLöschenIsDisabled(true);
    // setBtnÄndernIsDisabled(true);
    // setBtnNeuerVereinIsDisabled(false);
    // setVereinFormEditMode(true);
    //initVerein(setVerein);
  };

  handleRowHover = (event) => {
    this.setState({ selectedVerein: event.data });
  };

  handleRowSelect = (event) => {
    this.setState({ selectedVerein: event.data });
  };

  renderLoadingOrError = () => {
    const { loading, error } = this.state;
    if (loading) {
      return <div>Loading...</div>;
    }
    if (error) {
      return <div>Error: {error}</div>;
    }
    return null;
  };

  render() {
    const { data, selectedVerein, btnNeuerVereinIsDisabled } = this.state;

    const vereinAnz = data.length;

    const renderDetailsSection = () => {
      if (selectedVerein) {
        return (
          <div className="grid m-auto w-11">
            {FormFeld(selectedVerein.name, "Vereinsname", true)}
            {FormFeld(selectedVerein.abk, "Kurzname", true)}
            {FormFeld(selectedVerein.strasse, "Strasse", true)}
            {FormFeld(selectedVerein.plz, "PLZ", true)}
            {FormFeld(selectedVerein.ort, "Ort", true)}
            {FormFeld(selectedVerein.telefon, "Telefon", true)}
            {FormFeld(selectedVerein.bankName, "Bank", true)}
            {FormFeld(selectedVerein.kontoInhaber, "Kontoinhaber", true)}
            {FormFeld(selectedVerein.kiAnschrift, "Kontoinhaber-Adresse", true)}
            {FormFeld(selectedVerein.iban, "IBAN", true)}
            {FormFeld(selectedVerein.bic, "BIC", true)}
          </div>
        );
      }
      return null;
    };

    return (
      <div className="card">
        <MenueHeader headerText={`${vereinAnz} Vereine`} />
        {this.renderLoadingOrError()}
        <div className="border-solid m-auto w-11">
          <DataTable
            value={data}
            size="small"
            selectionMode="single"
            selection={selectedVerein}
            sortField="abk"
            sortOrder={1}
            scrollable
            scrollHeight="35vh"
            onRowHover={this.handleRowHover}
            onRowSelect={this.handleRowSelect}>
            <Column
              field="abk"
              header="Abkürzung"
              style={{
                minWidth: "200px",
              }}
              sortable></Column>
            <Column
              field="name"
              header="Verein"
              style={{
                minWidth: "200px",
              }}
              sortable></Column>
            <Column
              field="strasse"
              header="Strasse"
              style={{
                minWidth: "200px",
              }}></Column>
            <Column
              field="ort"
              header="Ort"
              style={{
                minWidth: "200px",
              }}
              sortable></Column>
          </DataTable>
        </div>
        <br />
        {renderDetailsSection()}

        <Button
          label="Neuer Verein"
          className="p-button-outlined m-2"
          onClick={this.btnNeuerVerein}
          disabled={btnNeuerVereinIsDisabled}
        />
      </div>
    );
  }
}

export default Vereine2;
